import { ThemeOptions } from '@mui/material/styles';

export const themeOptions: ThemeOptions = {
  palette: {
    mode: 'dark',
    primary: {
      main: '#dddce0',
      dark: '#3a066f',
      light: '#27005c',
    },
    secondary: {
      main: '#448aff',
    },
    background: {
      default: '#050127',
      paper: '#320077',
    },
  },
};
